import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import CardGame from "./components/regions/Cards/presentation";

function App() {
  return (
    <Router>
      <Route exact path="/" component={CardGame} />
    </Router>
  );
}

export default App;
